<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Dynamic Flex Table with Modal</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #f5f5f5;
            flex-direction: column;
        }
        .container {
            max-width: 1200px;
            overflow: auto;
        }
        .table {
            display: flex;
            flex-wrap: wrap;
            gap: 5px;
            border: 2px solid black;
            padding: 10px;
            background: white;
        }
        .cell {
            flex: 1;
            font-size: 30px;
            min-width: 50px;
            max-width: 50px;
            padding: 8px;
            text-align: center;
            background: lightgray;
            border: 1px solid black;
            cursor: pointer;
            transition: background 0.2s;
            flex-grow: 0;
        }
        .cell:hover {
            background: darkgray;
        }
        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.5);
            justify-content: center;
            align-items: center;
        }
        .row {
            display: flex;
            align-items: baseline;
            justify-content: left;
            gap: 5px;
            padding: 5px 0;
        }
        code {
            background: #f0f0f4;
        }
        .modal-content {
            background: white;
            padding: 20px;
            border-radius: 5px;
            text-align: center;
            position: relative;
        }
        .close {
            position: absolute;
            top: 10px;
            right: 15px;
            cursor: pointer;
            font-size: 20px;
            font-weight: bold;
        }
        #modal-description #setText {
            text-align: left;
        }
        #loading.hide {
            display: none;
        }
    </style>
</head>
<body>
<div id="loading">Loading...</div>
<div class="container">
    <div id="table" class="table"></div>
</div>

<div id="modal" class="modal">
    <div class="modal-content">
        <span class="close">&times;</span>
        <h2 id="modal-title"></h2>
        <p id="modal-description"></p>
    </div>
</div>

      let item = iconsData[i];
      const cell = document.createElement("div");
      cell.className = "cell";
      let name = item.name;
      cell.innerHTML = item.emojiHtml ? item.emojiHtml : item.textHtml;
      cell.title = name;
      cell.addEventListener("click", () => {
        modalTitle.innerHTML = item.textHtml + `<br>` + item.name;
        let iconContentHtml = '<div class="row">' + `<strong>Text mode:</strong> ` + `<code>${item.textContent}</code> ` + item.textHtml + '</div>';
        if (item.mathContent) {
          iconContentHtml += '<div class="row">' +`<strong>Math mode:</strong> ` + `<code>${item.mathContent}</code> ` + item.mathHtml + '</div>';
        }
        if (item.emojiContent) {
          iconContentHtml += '<div class="row">' +`<strong>Emoji:</strong> ` + `<code>${item.emojiContent}</code> ` + item.emojiHtml + '</div>';
        }
        iconContentHtml += "<h3>Colors:</h3>";
        if (item.nameColorContent) {
          iconContentHtml += '<div class="row">' +`<code>${item.nameColorContent}</code> ` + item.nameColorHtml + '</div>';
        }
        iconContentHtml += '<div class="row">' +`<code>${item.colorContent}</code> ` + item.colorHtml + '</div>';
        modalDescription.innerHTML = iconContentHtml;
        modal.style.display = "flex";
      });
      table.appendChild(cell);
    }
  const loading = document.getElementById('loading');
  loading.classList.add('hide')

  closeModal.addEventListener("click", () => {
    modal.style.display = "none";
  });

  window.addEventListener("click", (event) => {
    if (event.target === modal) {
      modal.style.display = "none";
    }
  });
</script>
</body>
</html>
